        private void LoadNextLevel(Level currentLevel, Sprite2d[] referenceinput)
        {
            //Sprite2d[] references = null;
            //if (currentLevel.artSetFolder == "screens")
            //{
            //    references = NoArtRefs;
            //}
            //if (currentLevel.artSetFolder == "plains")
            //{
            //    references = PlainsArtRefs;
            //}
            BGColor = currentLevel.levelColor;

            //Log.Highlight($"Enemy count before reinitialising list {enemies.Count}");
            enemies = new List<Enemy>();
            //Log.Highlight($"Enemy count after reinitialising list {enemies.Count}");

            Log.Info("New Level is being loaded");
            string[,] Map = currentLevel.firstMostLayer;
            currentLevelEndSize = Map.GetLength(1) * 16;
            LoadLayer(referenceinput, Map, currentLevel.artTagDefinitions);

            //set an object layer
            Map = currentLevel.objectRenderLayer;
            LoadObjectLayer(Map);

            //set a new fg layer
            Map = currentLevel.lastMostLayer;
            LoadLayer(referenceinput, Map, currentLevel.artTagDefinitions);

            //LoadHud() method doesnt exist yet, use for loading the hud.
            //current layer is loaded as facsimile of what it should do in the end.
            Map = currentLevel.hudLayer;
            LoadLayer(referenceinput, Map, currentLevel.artTagDefinitions);

            //the reason it is not existant is that loading the hud needs to stay still, relative to the player.
            //i currently do not have a way to do this yet. and thus, requires true layer implementation.

            //this method must handle loading the levels layers, color, tags and music to play.
        }

